/2019','EM ANDAMENTO','',''),(412,'XX-XX-XXXX',2018,'EDITAL INTERNO','0117/2018-01',1210233,'FABIANA APARECIDA LAZZARIN','TESSITURAS DIALÓGICAS NA CONSTRUÇÃO DA POLÍTICA INSTITUCIONAL PARA INCLUSÃO E ACESSIBILIDADE DOS ALUNOS COM DEFICIÊNCIA NO ÂMBITO DO ENSINO SUPERIOR','ACESSIBILIDADE','ENSINO SUPERIOR','POLITICA INSTITUCIONAL','','CIENCIAS SOCIAIS APLICADAS','CIENCIA DA INFORMACAO','','LAGENTI - Laboratório Interdisciplinar de Gestão e Tecnologia da Informação','EDITAL N.º 02/2018/PRPI – CHAMADA PIICT/CNPq-UFCA','15/08/2018','31/07/2021','EM ANDAMENTO','',''),(413,'XX-XX-XXXX',2018,'EDITAL INTERNO','0118/2018-01',1548730,'REGIANE LORENZETTI COLLARES','SEXUALIDADE E POLÍTICA NO PENSAMENTO DE MICHEL FOUCAULT E JUDITH BUTLER','SUBJETIVIDADE','GENERO','VERDADE','','CIENCIAS HUMANAS','FILOSOFIA','','Cartografias da Subjetividade','EDITAL N.º 02/2018/PRPI – CHAMADA PIICT/CNPq-UFCA','15/08/2018','31/07/2019','EM ANDAMENTO','',''),(414,'XX-XX-XXXX',2018,'EDITAL INTERNO','0119/2018-01',2639946,'REBECA DA ROCHA GRANGEIRO','O CONSUMO DE OBJETOS ARTESANAIS: PERFIL, HÁBITOS DE CONSUMO E MOTIVAÇÕES DE COMPRA','','','','','CIENCIAS SOCIAIS APLICADAS','ADMINISTRACAO','','Laboratório Interdisciplinar de Estudos em Gestão Social - LIEGS','EDITAL N.º 02/2018/PRPI – CHAMADA PIICT/CNPq-UFCA','15/08/2018','31/07/2020','EM ANDAMENTO','',''),(415,'XX-XX-XXXX',2018,'EDITAL INTERNO','0120/2018-01',2080200,'FRANCISCO RANIERE MOREIRA DA SILVA','DESAFIOS À CONSOLIDAÇÃO DE ARRANJOS INSTITUCIONAIS DE GOVERNANÇA METROPOLITANA – UMA ANÁLISE NA REGIÃO METROPOLITANA DO CARIRI','GOVERNANCA','DESENVOLVIMENTO TERRITORIAL','ARRANJOS INSTITUCIONAIS','','CIENCIAS SOCIAIS APLICADAS','ADMINISTRACAO','','Laboratório Interdisciplinar de Estudos em Gestão Social - LIEGS','EDITAL N.º 02/2018/PRPI – CHAMADA PIICT/CNPq-UFCA','15/08/2018','31/07/2019','EM ANDAMENTO','',''),(416,'XX-XX-XXXX',2018,'EDITAL INTERNO','0121/2018-01',385040,'SAMI JORGE MICHEREFF','DESENVOLVIMENTO DE INICIADORES ESPECÍFICOS PARA IDENTIFICAÇÃO DE ESPÉCIES DE MACROPHOMINA CAUSADORAS DA PODRIDÃO CINZENTA EM FEIJÃO-CAUPI NO CARIRI CEARENSE','MACROPHOMINA','DEIVERSIDADE DE ESPÉCIE','VIGNA UNGUICULATA','O feijão-caupi é a leguminosa alimentar mais importante da região semiárida do Nordeste brasileiro, incluindo na mesorregião do Cariri cearense. A produtividade do feijão-caupi é severamente afetada pela ocorrência da podridão cinzenta do caule. Essa doença é causada por três espécies do fungo do gênero Macrophomina: M. phaseolina, M. pseudophaseolina e M. euphorbiicola. A identificação precisa dos agentes patogênicos é fundamental para o desenvolvimento de cultivares de plantas resistentes às doenças, bem como para estudos de diversidade de espécies dos patógenos em materiais de propagação e restos culturais. Atualmente, a identificação das espécies de Macrophomina é realizada com a utilização de ferramentas moleculares baseadas na análise multilocus de vários genes. No entanto, essas técnicas são trabalhosas, têm custo elevado e demandam tempo. Como alternativa, a utilização de iniciadores específicos proporciona a identificação das espécies com baixo custo e rapidez. Até o momento foram desenvolvidos iniciadores específicos somente para M. phaseolina, tendo em vista de as outras duas espécies foram descritas a partir de 2014. O objetivo desse projeto é desenvolver iniciadores específicos para identificação das espécies de Macrophomina e investigar as espécies associadas à podridão cinzenta do feijão-caupi no Cariri cearense.','CIENCIAS AGRARIAS','CIENCIAS AGRARIAS I','FITOSSANIDADE','','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/08/2019','EM ANDAMENTO','','UFCA'),(417,'XX-XX-XXXX',2018,'EDITAL INTERNO','0122/2018-01',1881416,'JUAN CARLOS ALVAREZ PIZARRO','ACÚMULO DE OSMÓLITOS ORGÂNICOS E DOS ÍONS NA+ E K+ NAS GRAMÍNEAS FORRAGEIRAS, PANICUM MAXIMUM E BRACHIARIA BRYZANTHA, SOB CONDIÇÕES DE SALINIDADE','CAPINS','POTÁSSIO','TOLERÂNCIA','O controle da homeostase do K+ e Na+ e o acúmulo de solutos orgânicos são mecanismos-chave da tolerância à salinidade. Objetivou-se estudar a contribuição desses mecanismos em duas gramíneas forrageiras importantes para o semiárido cearense, Panicum maximum e Brachiaria bryzantha. Sementes desses materiais serão germinadas em vermiculta e, após 10 dias, as plântulas serão transferidas para soluções nutritivas onde serão cultivadas por uma semana. Em seguida, as plantas serão expostas por 9 dias a 0, 25, 50 e 100 mM de NaCl. O cultivo será realizado em casa de vegetação. Para entender a regulação iônica, analisar-se-á os íons Na+ e K+ no fluído do xilema, e em folhas, colmos e raízes. Para estudar o papel dos solutos orgânicos na osmoproteção, açúcares solúveis, prolina, proteínas e aminoácidos totais serão quantificados. Avaliar-se-á também o potencial osmótico, o conteúdo relativo de água, os danos de membrana e a peroxidação lipídica. Em um segundo experimento, as plantas serão cultivadas para realizar medições da velocidade de influxo de K+ e estudar a contribuição dos transportadores ao processo de absorção de K+ sob salinidade. Espera-se que os dados gerados contribuam à identificação de espécies e/ou cultivares que se desenvolvam melhor nessas condições.','CIENCIAS AGRARIAS','CIENCIAS AGRARIAS I','','MECANISMOS DE ADAPTAÇÃO AOS ESTRESSES HÍDRICOS E SALINO EM GRAMÍNEAS FORRAGEIRAS','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/08/2019','EM ANDAMENTO','','UFCA'),(418,'XX-XX-XXXX',2018,'EDITAL INTERNO','0123/2018-01',1998510,'WANESSA NEPOMUCENO FERREIRA','O USO DE ESPÉCIES EXÓTICAS VS. NATIVAS NA ARBORIZAÇÃO DAS CIDADES DO ENTORNO DA CHAPADA DO ARARIPE.','COMPOSIÇÃO FLORÍSTICA','ARBORIZAÇÃO','ESPÉCIES EXÓTICAS','A arborização urbana que valoriza plantas nativas tem grande importância na conservação da biodiversidade local. Muitas espécies exóticas não causam nenhum problema ecológico, porém, aquelas que conseguem se transformar em invasoras podem causar riscos consideráveis aos ecossistemas e ter um alto custo para o controle. Dentro desse contexto, pretende-se analisar a arborização urbana e o conhecimento popular sobre espécies nativas e exóticas em cidades do entorno da Chapada do Araripe, comparando-se as cidades que possuem áreas da Floresta Nacional do Araripe (Crato e Barbalha) àquelas que não possuem (Abaiara e Brejo Santo). Para cada cidade, será realizado um inventário da composição florística e estrutura das árvores, coletando-se dados de altura, diâmetro do caule e cobertura da copa, além de material botânico fértil para herborização e identificação por especialistas. As espécies exóticas que forem registradas serão classificadas em casuais, naturalizadas ou invasoras. Para investigar o conhecimento da população, serão realizadas entrevistas com moradores das cidades. Se no inventário forem registradas muitas espécies exóticas com potencial invasor, principalmente em cidades que possuem áreas da FLONA-Araripe, este trabalho poderá sensibilizar os órgãos competentes para a necessidade de reduzir o plantio de tais espécies e o controle ou remoção de indivíduos já existentes.','CIENCIAS BIOLOGICAS','BIODIVERSIDADE','','','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/07/2020','EM ANDAMENTO','','UFCA'),(419,'XX-XX-XXXX',2018,'EDITAL INTERNO','0124/2018-01',2528282,'MARCOS ANTONIO PEREIRA DE LIMA','ASSOCIAÇÃO DO VÍRUS EPSTEIN-BARR (EBV) COM O CARCINOMA CERVICAL: INVESTIGAÇÃO DE UMA SÉRIE DE CASOS PROCEDENTES DA REGIÃO DO CARIRI, ESTADO DO CEARÁ.','CÂNCER DO COLO UTERINO','EBV','CARCINOGÊNESE','O câncer de colo uterino (câncer cervical) representa um sério problema de saúde pública mundial. Neste contexto, a infecção por genótipos de alto-risco de HPV figura como principal fator de risco. Entretanto, estudos atuais têm demonstrado que o vírus Epstein-Barr (EBV) pode desempenhar um papel relevante neste processo, possivelmente como co-fator, o que poderia comprometer as atuais abordagens terapêuticas e profiláticas voltadas exclusivamente à infecção por HPV. O presente estudo visa avaliar a associação do EBV com o carcinoma cervical em uma série de casos coletados em um Hospital de referência em Oncologia, da Região do Cariri, e em casos de neoplasias intraepiteliais de graus variados coletados no ambulatório de ginecologia da Faculdade de Medicina da UFCA, bem como comparar os resultados com a detecção de Papilomavírus Humano (HPV). A carga viral de EBV será avaliada através da técnica de qPCR (real-timePCR), enquanto os transcritos EBERs serão verificados através de hibridação in situ (RISH). A infecção por HPV será verificada por Nested-PCR.','CIENCIAS DA SAUDE','MEDICINA II','','EPIDEMIOLOGIA DAS DOENÇAS INFECCIOSAS','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/07/2020','EM ANDAMENTO','','UFCA'),(420,'XX-XX-XXXX',2018,'EDITAL EXTERNO','0003/2018-02',2513585,'FRANCISCO JOSE DE PAULA FILHO','RECUPERAÇÃO DE METAIS PESADOS DE REJEITOS DA INDÚSTRIA METAL MECÂNICA REGIONAL PELO USO TECNOLOGIAS QUÍMICAS PARA O DESENVOLVIMENTO SUSTENTÁVEL','REÚSO DE ÁGUA','RECUPERAÇÃO DE METAIS','RESÍDUOS E EFLUENTES INDUSTRIAIS ','A introdução descontrolada de poluentes no ambiente aquático é atualmente um dos problemas que devem ter atenção prioritária para a preservação de fontes de água potável em muitos países ao redor do mundo, quer sejam desenvolvidos ou em desenvolvimento. Neste contexto, os recursos advindos da indústria metal mecânica são decisivos para a base econômica de muitos países, inclusive o Brasil. Paralelamente, são produzidas grandes quantidades de rejeitos ricos em metais tóxicos, os quais são veículos de contaminação para os corpos hídricos e solos receptores. Portanto, a proposta visa viabilizar métodos de reaproveitamento de resíduos e tratamento dos efluentes gerados, usando tecnologias adaptadas a realidade técnica e econômica local. A meta é atingir os padrões de lançamento de efluentes vigentes e a sustentabilidade da atividade além da preservação dos recursos hídricos. A implementação de tecnologias para o reaproveitamento de metais gerando novos materiais, desenvolvimento de novos materiais bioadsorventes para o tratamento de efluentes líquidos industriais, tornam-se ainda mais relevantes no atual cenário de escassez hídrica regional, permitindo o reúso da água, a reintrodução de metais no processo de produção e geração de novos materiais, minimizando a produção de resíduos e efluentes pelo setor metal mecânico do Estado do Ceará.','CIENCIAS EXATAS E DA TERRA','QUIMICA','','DESENVOLVIMENTO DE METODOLOGIAS DE ANÁLISE COM PROPOSTA PARA USO NO SETOR PRODUTIVO; DESENVOLVIMENTO E APLICAÇÃO DE MATERIAIS ELETRÓDICOS','BOLSAS DE PRODUTIVIDADE EM PESQUISA, ESTÍMULO À INTERIORIZAÇÃO E À INOVAÇÃO TECNOLÓGICA – BPI 03/2018','01/09/2018','01/06/2021','EM ANDAMENTO','','FUNCAP'),(421,'XX-XX-XXXX',2018,'EDITAL INTERNO','0125/2018-01',2372885,'LEANDRO DA SILVA TAVARES','EXISTÊNCIA E MULTIPLICIDADE DE SOLUÇÕES PARA UMA CLASSE DE EQUAÇÕES DIFERENCIAIS PARCIAIS ELÍPTICAS NÃO-LINEARES','ORLICZ','SUB SUPERSOLUÇÃO','SINGULARIDADE','','CIENCIAS EXATAS E DA TERRA','MATEMATICA / PROBABILIDADE E ESTATÍSTICA','','EQUAÇÕES DIFERENCIAIS PARCIAIS NÃO LINEARES','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/09/2019','EM ANDAMENTO','','UFCA'),(422,'XX-XX-XXXX',2018,'EDITAL INTERNO','0126/2018-01',1373579,'ANTONIO CARLOS ALONGE RAMOS','INFLUÊNCIA DA CURVATURA SUPERFICIAL E DA VIOLAÇÃO DE SIMETRIAS NO TRANSPORTE ELETRÔNICO EM SEMICONDUTORES','SEMICONDUTORES','PONTOS QUÂNTICOS','SIMETRIAS','','CIENCIAS EXATAS E DA TERRA','ASTRONOMIA / FISICA','','FÍSICA DO ESTADO SÓLIDO','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/09/2019','EM ANDAMENTO','','UFCA'),(423,'XX-XX-XXXX',2018,'EDITAL INTERNO','0127/2018-01',2359945,'ELIAS PEREIRA LOPES JUNIOR','MAPEAMENTO DA MATURIDADE TECNOLÓGICA DOS PROJETOS DA UFCA','MAPEAMENTO','MATURIDADE TECNOLÓGICA','PROJETOS','A escala de Technology Readiness Level (TRL) já permitiu várias análises dos processos de transferência de tecnologia e inovação tecnológica. Por meio do uso da escala Demand Readiness Level (DRL), pode-se gerar um novo sistema de referência para melhor abordar a abordagem market pull, fazendo transferência de tecnologia e inovação tecnológica. Portanto, a utilização dessas duas ferramentas pode melhorar significativamente a inovação e as práticas de transferência de tecnologia da região do Cariri, fazendo com que as parcerias entre ICTs e o mercado criem valor. Este projeto tem como objetivo analisar o nível de maturidade tecnológica dos projetos da UFCA e comparar o nível de maturidade tecnológica com o nível de prontidão da demanda de empresas da região do Cariri. Com a identificação do nível de maturidade tecnológica dos projetos e a interação com o nível de prontidão da demanda de empresas da região do Cariri espera-se gerar um diagnóstico dos projetos analisados a respeito dos seus níveis de maturidade tecnológica. A partir desses dados e com a utilização da escala DRL, pode-se gerar como resultado a formação de novas parcerias entre as ICTs e empresas da região do Cariri no sentido de promover mais ações inovadoras para a região.','CIENCIAS SOCIAIS APLICADAS','ADMINISTRACAO PUBLICA E DE EMPRESAS, CIENCIAS CONTABEIS E TURISMO','','','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/08/2020','EM ANDAMENTO','','UFCA'),(424,'XX-XX-XXXX',2018,'EDITAL INTERNO','0128/2018-01',2571363,'BEATRIZ GONDIM MATOS','CONSUMO COLABORATIVO E RELACIONAL: UM ESTUDO COM ANFITRIÕES DO COUCHSURFING NA CIDADE DE JUAZEIRO DO NORTE','CONSUMO COLABORATIVA','CONSUMO RELACIONAL','COUCHSURFING','O consumo colaborativo pode ser interpretado como uma troca relacional por parte daqueles dos sujeitos que buscam obter estas interações (JOHN, 2013; MATOS; BARBOSA; MATOS, 2016; WITTEL, 2011). A troca relacional implica dizer que os aspectos sociais se sobrepõem aos aspectos tangíveis nas relações de consumo. Dentre as práticas de consumo colaborativo, este estudo irá se desenvolver no contexto da hospedagem da rede colaborativa Couchsurfing. Com o intuito de compreender quais são as motivações dos membros que integram a rede, a pesquisa adotará a estratégia de pesquisa narrativa junto aos anfitriões da rede que residem na cidade de Juazeiro do Norte.','CIENCIAS SOCIAIS APLICADAS','ADMINISTRACAO PUBLICA E DE EMPRESAS, CIENCIAS CONTABEIS E TURISMO','','ESTUDOS SOBRE CONSUMO','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/08/2019','EM ANDAMENTO','','UFCA'),(425,'XX-XX-XXXX',2018,'EDITAL INTERNO','0129/2018-01',1764691,'JOSE ROBSON MAIA ALMEIDA','PRÁTICAS DE ENSINO MUSICAL NA REGIÃO DO CARIRI CEARENSE','ENSINO DE MÚSICA','ATUAÇÃO PROFISSIONAL','PRÁTICAS PEDAGÓGICAS','','LINGUISTICA, LETRAS E ARTES','ARTES / MUSICA','','PRÁTICAS METODOLÓGICAS DO ENSINO DE INSTRUMENTOS','EDITAL N° 04/2018/PRPI – APOIO A PROJETOS DE PESQUISA','01/09/2018','01/08/2019','EM ANDAMENTO','','UFCA'),(426,'XX-XX-XXXX',2018,'EDITAL EXTERNO','0004/2018-02',1123441,'KAMILA CAMARA CORREIA','PODRIDÃO DA COROA DA BANANA NO CARIRI CEARENSE: LEVANTAMENTO, EPIDEMIOLOGIA, FUNGOS CAUSADORES E SENSIBILIDADE A FUNGICIDAS','','','','','CIENCIAS AGRARIAS','AGRONOMIA','','','BOLSAS DE PRODUTIVIDADE EM PESQUISA, ESTÍMULO À INTERIORIZAÇÃO E À INOVAÇÃO TECNOLÓGICA – BPI 03/2018','01/08/2018','30/07/2020','EM ANDAMENTO','','FUNCAP'),(427,'XX-XX-XXXX',2018,'EDITAL EXTERNO','0005/2018-02',1569922,'PAULO EDUARDO SILVA LINS CAJAZEIRA','CARTOGRAFIA DOS CURSOS DE JORNALISMO: INTERIORIZAÇÃO E EXPANSÃO DA EDUCAÇÃO SUPERIOR FEDERAL NO BRASIL','','','','','CIENCIAS SOCIAIS APLICADAS','COMUNICACAO','','','BOLSAS DE PRODUTIVIDADE EM PESQUISA, ESTÍMULO À INTERIORIZAÇÃO E À INOVAÇÃO TECNOLÓGICA – BPI 03/2018','01/08/2018','30/07/2020','EM ANDAMENTO','','FUNCAP'),(428,'XX-XX-XXXX',2018,'EDITAL EXTERNO','0006/2018-02',2334847,'FRANCISCO WIRLEY PAULINO RIBEIRO','SÍNTESE E CARACTERIZAÇÃO DE SEMICONDUTORES PARA APLICAÇÃO COMO SENSORES E BIOSSENSORES FOTOELETROQUÍMICOS','','','','','CIENCIAS EXATAS E DA TERRA','QUIMICA','','','BOLSAS DE PRODUTIVIDADE EM PESQUISA, ESTÍMULO À INTERIORIZAÇÃO E À INOVAÇÃO TECNOLÓGICA – BPI 03/2018','01/08/2018','30/07/2020','EM ANDAMENTO','','FUNCAP'),(429,'XX-XX-XXXX',2018,'EDITAL EXTERNO','0007/2018-02',2317478,'SAMUEL CARDOZO RIBEIRO','DA LAMA AO CAOS: QUAL A INFLUÊNCIA DOS LIXÕES NA RELAÇÃO ENTRE ENDOPARASITAS E O “SAPO CURURU,” RHINELLA JIMI (STEVAUX, 2002)?','','','','','CIENCIAS BIOLOGICAS','PARASITOLOGIA','','','BOLSAS DE PRODUTIVIDADE EM PESQUISA, ESTÍMULO À INTERIORIZAÇÃO E À INOVAÇÃO TECNOLÓGICA – BPI 03/2018','01/08/2018','30/07/2020','EM ANDAMENTO','','FUNCAP');
